import React from "react";

import cardsStyle from "./cards.module.css"


const cards = ({infocards}) => {
  const cardsItem = infocards.map(({name, desc, link}, ind) =>(
      <div className="cardsItem">
        <h2>{}</h2>
      </div>
  ))
  return(
    <div></div>
  )
}
export default cards
